const milisec_to_date = (date, format) => {
  // let endDay = new Date(date + 84600 * 2 * 1000);
  // console.log(endDay, "end");

  const today = new Date(Date.now() + 86400 * 1000 * 1.2);
  console.log(today, "today");

  let startDay = new Date(date).getTime();
  let now = Date.now();

  if (endDay < now) {
    let rate = "khoa học đã hoàn thành";
    return rate;
  } else {
    let rate = `${parseInt(((now - startDay) * 100) / (endDay - startDay))}%`;
    return rate;
  }
};

export default milisec_to_date;
